features.script:
let myVideo = parcel.getFeatureById('UnknownCreature')

feature.on('trigger',e=>{
  myVideo.play()
})

if(!feature.get('trigger'))
myVideo.stop()

let myVideo1 = parcel.getFeatureById('rtljcR')
let myVideo2 = parcel.getFeatureById('rtljcM')
let myVideo3 = parcel.getFeatureById('rtljcL')

feature.on('trigger',e=>{
  myVideo1.play()
  myVideo2.play()
  myVideo3.play()
})

if(!feature.get('trigger'))
  myVideo1.stop()
  myVideo2.stop()
  myVideo3.stop()
